NodeJS checking multiple db entries by looping through mongoose queries<p>I have a situation where a user checks off a list of companies in a form and then submits the form, which includes a file upload. This gets passed to the server by a string of IDs separated by ';' as a multipart/form.</p>
<p>On the NodeJS side, I'd like to check that all of these company IDs exist in the database, plus check some other things, and if any of these checks fails, then 1) delete the files uploaded (which, since I'm using Multer, I upload to a temp folder while checking some of these things; 2) return an error.</p>
<p>Something along these lines:</p>
<pre><code>router.post(&quot;/&quot;, [ ... some express validator stuff ... ], upload.array('files'),
(req, res, err) =&gt; {

    const errors = validationResult(req);

    if (err instanceof multer.MulterError) {
        // A Multer error occurred when uploading.
        errors.push({ message: &quot;FILE_UPLOAD_ERROR&quot; });
    }

    // Date error
    var date = new Date(req.body.date);
    const dateError = !date.getTime();
    if (dateError) {
        errors.push({ message: &quot;INVALID_DATE&quot; });
    }

    // Check whether companies exist
    var companies = req.body.companies.split(&quot;;&quot;);

    for (var i = 0; i &lt; companies.length; i++) {
        companySchema.findById( companies[i], function (err, company) {
            if (err || !company) {
                errors.push({ message: &quot;COMPANY_NOT_EXIST_ERROR&quot;});
            }
        } );
    }

    if (!errors.isEmpty()) {

        for (var i = 0; i &lt; req.files.length; i++) {
            try {
                fs.unlinkSync(temp_folder + req.files[i].filename);
            } catch(err) {
                errors.push({ message: &quot;DELETE_FILE_ERROR&quot;});
            }
        }

        return res.status(422).json({
            message: errors.message
        })
    }
    else { console.log(&quot;success!&quot;)};

});
</code></pre>
<p>Obviously the snippet: <code>                if (err || !company) { errors.push({ message: &quot;COMPANY_NOT_EXIST_ERROR&quot;}); }</code> causes a couple issues, including: I believe it's async so the rest of the code executes before these queries are done; the scope of the query can't see my 'errors' variable, I don't know how to handle the error/result. Any help is appreciated.</p>

