          // other fields
        }
      ]
    },
</code></pre>
<p>I am aggregating a users collection:</p>
<pre><code>db.boards.aggregate([
  { '$match' =&gt; { _id: 65 } },
  { '$lookup' =&gt; 
        { from: &quot;users&quot;, as: &quot;users&quot;,
          let: { &quot;board_id&quot;: &quot;$_id&quot; },
