                    { '$in' =&gt; [&quot;$$board_id&quot;, &quot;$participations.participant_id&quot;] }, 
                 ]
              }}
            }
          ],
        } 
      },
])
</code></pre>
<p>However, the above logic is flawed. If a user has a participation in a team with the id 65, then that user will show up, even though he doesn't have a participation in the board.</p>
