<p>I want to be able to find all the person objects in that array and return their stats.
So essentially the final output after using the array of strings would be</p>
<pre><code>Person1: { Stat1: 2, Stat2: 0, Stat3: 0, Stat4: 2, Stat5: 4 },
Person2: { Stat1: 4, Stat2: 0, Stat3: 0, Stat4: 2, Stat5: 2 }
